import React, { Component } from 'react';

class WishMessage extends Component{

    constructor(){
        super();
        this.state ={
            message:'Good Morning',
            color:['white','black','silver','orange']
        }
    }

  render(){
      return(
          <div>
             <h1>{this.state.message}</h1> 
             <li>{this.state.color[0]} </li>
             <li>{this.state.color[1]} </li>
             <li>{this.state.color[2]} </li>
          </div>
      );
  }
}

export default WishMessage;
